⁣
It's normal to worry, so don't feel bad if this is you, but these are a few things that you can probably cross off your plate. ⁣
⁣
1) Sneezing often⁣
⁣
Newborn's sneezing is simply how they clear their nasal and respiratory passages of congestion and airborne particles.⁣
⁣
2) Breast v Bottle ⁣
⁣
If you want to breastfeed, but are struggling it’s okay to pump and feed the baby through a bottle. Keep trying to breastfeed, but the mostt important thing is baby is getting fed.⁣
⁣
3) Hitting milestones / keeping up⁣
⁣
Your baby will walk, talk, and roll over at different times than someone else’s baby. There’s no need to compare or worry unless your Dr. expresses concerns.⁣
⁣
4) Pleasing Everyone⁣
⁣
The reality is that you’re not going to parent exactly like everyone wants to and everyone’s going to have their own opinion. Do what works for you.⁣
⁣
5) Being Perfect⁣
⁣
New Moms often worry that any mistakes made early will have lasting effects. We’re all figuring this out as we go and for the most part your baby will have no idea you’re winging it.⁣
⁣
6) Losing the baby weight⁣
⁣
At Juna we’re all about sustainable and healthy practices. That's why we have 3 phases of Postpartum in the Juna App to make sure you are coming back slowly and effectively. Remember to take time for yourself, eat whole healthy foods, heal, and get back to it when you’re ready. ⁣
